710bea48d7.jpg','','','','高山南,山崎和佳奈,神谷明,小山力也,林原惠美,山口胜平,田中秀幸,岛本须美,绪方贤一,堀川亮,松井菜樱子,宫村优子,岩居由希子,大谷育江,高木涉,高岛雅罗,堀之纪,立木文彦,小山茉美,三石琴乃,置鲇龙太郎,日高范子,池田秀一,古谷彻','儿玉兼嗣,山本泰一郎,佐藤真人,于地纮仁','青山刚昌,古内一成,柏原宽司,宫下隼一','','　　工藤新一是全国著名的高中生侦探，在一次追查黑衣人犯罪团伙时不幸被团伙成员发现，击晕后喂了神奇的药水，工藤新一变回了小孩！新一找到了经常帮助他的阿笠博士，博士为他度身打造不少间谍武器。为了防止犯罪团','更新至第1233集','1996-01-08',0,'0','','','日本','日语','1996','','正片','','','','','',0,0,0,0,0,0,0,181,37,455,633,'',405,272,10.0,20,2,1757923894,1740830369,0,0,0,1463371,9.2,'','','','','','','','','','<p>　　工藤新一是全国著名的高中生侦探，在一次追查黑衣人犯罪团伙时不幸被团伙成员发现，击晕后喂了神奇的药水，工藤新一变回了小孩！新一找到了经常帮助他的阿笠博士，博士为他度身打造不少间谍武器。为了防止犯罪团伙对他进行报复，新一决定隐姓埋名，暗中追查他们，希望能得到解药。一日，新一 的女友毛利兰来到了阿笠博士的家寻找男友的下落，被小兰撞见的新一情急之下编造了自己名叫江户川柯南，随后柯南寄居在了小兰家。小兰的父亲毛利小五郎是一名私家侦探，新一可以籍着和他一起四出办案一起追查黑夜人的下落。柯南在小学认识步美等小学生，他们一起组织了一个少年侦探团，向罪犯宣战！</p>','dyttm3u8','no','','第01集$https://vip.dytt-cinema.com/20250303/14693_25989f1d/index.m3u8#第02集$https://vip.dytt-cinema.com/20250303/14694_0806a60e/index.m3u8#第03集$https://vip.dytt-cinema.com/20250303/14695_4662efeb/index.m3u8#第04集$https://vip.dytt-cinema.com/20250303/14696_f74d6ef8/index.m3u8#第05集$https://vip.dytt-cinema.com/20250303/14697_d0ec7deb/index.m3u8#第06集$https://vip.dytt-cinema.com/20250303/14698_d604dd85/index.m3u8#第07集$https://vip.dytt-cinema.com/20250303/14699_bc08ce9d/index.m3u8#第08集$https://vip.dytt-cinema.com/20250303/14700_f71b273d/index.m3u8#第09集$https://vip.dytt-cinema.com/20250303/14701_744124dd/index.m3u8#第10集$https://vip.dytt-cinema.com/20250303/14702_9f44fdee/index.m3u8#第11集$https://vip.dytt-cinema.com/20250303/14703_244e6b76/index.m3u8#第12集$https://vip.dytt-cinema.com/20250303/14704_ef1f3fc8/index.m3u8#第13集$https://vip.dytt-cinema.com/20250303/14705_38398fab/index.m3u8#第14集$https://vip.dytt-cinema.com/20250303/14706_8e28c44c/index.m3u8#第15集$https://vip.dytt-cinema.com/20250303/14707_db822956/index.m3u8#第16集$https://vip.dytt-cinema.com/20250303/14708_ba2cf414/index.m3u8#第17集$https://vip.dytt-cinema.com/20250303/14709_e1b97c78/index.m3u8#第18集$https://vip.dytt-cinema.com/20250303/14710_