,'万润泽','','　　《超限斗神》是一部中国新特摄剧，讲述了主角“巴特迩”和其他斗神战士的故事。剧中还有一位重要的斗神形象“塔米尔”，被称为“苍蓝猛兽”。这部剧以其独特的中国风格吸引了大量粉丝的关注。　　《超限斗神》的','更新至第12集','2025-07-12',0,'0','','','大陆','国语','2025','','正片','','','','','',0,0,0,0,0,0,0,534,235,288,692,'',940,499,2.0,1752,876,1757923894,1752631524,0,0,0,37234726,0.0,'','','','','','','','','','<p>　　《超限斗神》是一部中国新特摄剧，讲述了主角“巴特迩”和其他斗神战士的故事。剧中还有一位重要的斗神形象“塔米尔”，被称为“苍蓝猛兽”。这部剧以其独特的中国风格吸引了大量粉丝的关注。<br/>　　《超限斗神》的创作始于2017年的《天启先锋》，经过多年的努力和发展，终于在2025年推出了这部备受瞩目的作品。出品人叮当先生和他的团队花费了12年的时间，克服了许多困难，逐步实现了他们的特摄梦。他们不仅设计了精致的角色造型，还在制作过程中不断更新和完善。<br/>　　许多特摄爱好者对《超限斗神》表示了极大的兴趣和支持。网友们纷纷点赞和转发，表达了对中国特摄未来的期望。大家认为，《超限斗神》不仅是创作者们的梦想实现，也是中国特摄走向更高水平的一个标志。</p>','dyttm3u8','no','','第01集$https://vip.dytt-hot.com/20250716/96727_b3ba0906/index.m3u8#第02集$https://vip.dytt-hot.com/20250716/96728_efed3156/index.m3u8#第03集$https://vip.dytt-cinema.com/20250719/27438_1cbb2344/index.m3u8#第04集$https://vip.dytt-cinema.com/20250726/28219_941510c7/index.m3u8#第05集$https://vip.dytt-hot.com/20250802/97619_fc7f5c2a/index.m3u8#第06集$https://vip.dytt-cinema.com/20250809/29633_b05445d6/index.m3u8#第07集$https://vip.dytt-cinema.com/20250816/30513_c5c6dcfc/index.m3u8#第08集$https://vip.dytt-cinema.com/20250823/31442_43226732/index.m3u8#第09集$https://vip.dytt-cinema.com/20250830/32625_f3cfc5cb/index.m3u8#第10集$https://vip.dytt-cine.com/20250906/55083_dfffa7cd/index.m3u8#第11集$https://vip.dytt-cine.com/20250913/55837_acd6425f/index.m3u8#第12集$https://vip.dytt-cine.com/20250913/55838_30c02ee9/index.m3u8','','','','',0,'',''),(86,20,0,0,'冰雪女皇之冬日魔咒','冰雪皇后2 / 冰雪女王2 / 冰雪女王2：冬日魔咒 / The Snow Queen 2 / Snezhnaya koroleva 2. Snezhnyy korol / The Snow Queen: Magic of the Ice Mirror / The Snow Queen 2: The Snow King','bingxuenvhuangzhidongrimozhou',1,'B','','','动画,家庭','https://vip.dytt-img.com/upload/vod/20250913-1/b52cdea22de114449d0e9b5eaca23499.jpg','','','','伊莎贝拉·弗尔曼,沙尔托·科普雷,肖恩·宾,贝拉·索恩','阿列克谢·特斯蒂斯林','弗拉迪米尔·尼古拉耶夫,罗曼·尼波米亚西,阿列克谢·斯梅斯洛夫,阿列克谢·特斯蒂斯林','','　　从冰雪女王那儿被解救出来的奥姆生活在小镇上，他厌倦了繁重的工作，谎言心魔再一次缠上了他。不久公主被北风绑架，国王宣布谁能够解救出公主，就可以迎娶她。为此，奥姆再次踏上漫