,0,'0','','','大陆','国语','2024','','','','','','','',0,0,0,0,0,0,0,878,665,80,661,'',522,706,10.0,9800,980,1757923910,1757255480,0,0,0,0,0.0,'','','','','','','','','','<p><br/></p><p>正在观看《哪吒闹海》的男主瞧不上封神榜上神仙战斗到最后皆向他人卑躬屈膝的结局，龙神之祖认可了他的志向。伴随着阵阵龙吟，男主穿越到商周时期的封神榜世界，成为了东海龙宫的大太子敖凡。然而，龙神之祖虽有预知未来的能力，却早已在上古大战中龙气尽失，无法继续保护敖凡，此时的龙宫也早已不是封神榜上神仙的对手，生灵有倒悬之急，龙宫如累卵之危！面对灭顶之灾的地狱开局，龙祖的残魂显现！敖凡获得了给万物加点的能力，他当机立断给自己的修为加点，一秒完成突破，打退哪吒的进攻，救下了自己的兄弟。但也宣告着男主正式加入到了封神大劫的斗争中。而在系统的帮助下，在魔高一尺，道高一丈的战斗中，敖凡终将成为封神榜时代最强的神仙！若是封神大劫开启，龙族必将走向没落与衰亡。且看敖凡继承东海龙宫，成为新一代东海龙王，让龙族再次伟大！</p>','dyttm3u8','no','','第01集$https://vip.dytt-tv.com/20250907/41902_4feb05f0/index.m3u8#第02集$https://vip.dytt-tv.com/20250907/41903_4aff4e26/index.m3u8#第03集$https://vip.dytt-tv.com/20250907/41904_9c9f0a96/index.m3u8#第04集$https://vip.dytt-tv.com/20250907/41905_a3c31a07/index.m3u8#第05集$https://vip.dytt-tv.com/20250907/41906_006320a8/index.m3u8#第06集$https://vip.dytt-tv.com/20250907/41907_ca904c1d/index.m3u8#第07集$https://vip.dytt-tv.com/20250907/41908_a34335a3/index.m3u8#第08集$https://vip.dytt-tv.com/20250907/41909_7a4127a6/index.m3u8#第09集$https://vip.dytt-tv.com/20250907/41910_fe77dbe4/index.m3u8#第10集$https://vip.dytt-tv.com/20250907/41911_862690c6/index.m3u8#第11集$https://vip.dytt-tv.com/20250907/41912_a18fb9ee/index.m3u8#第12集$https://vip.dytt-tv.com/20250907/41913_42cbcf5f/index.m3u8#第13集$https://vip.dytt-tv.com/20250907/41914_98bedaa8/index.m3u8#第14集$https://vip.dytt-tv.com/20250907/41915_2434bffa/index.m3u8#第15集$https://vip.dytt-tv.com/20250907/41916_81fa8ad1/index.m3u8#第16集$https://vip.dytt-tv.com/20250907/41917_6e280321/index.m3u8#第17集$https://vip.dytt-tv.com/20250907/41918_2e8f1f7c/index.m3u8#第18集$https://vip.dytt-tv.com/20250907/41919_fe7d8d22/index.m3u8#第19集$https://vip.dytt-tv.com/20250907/41920_15bd55b0/index.m3u8#第20集$https://vip.dytt-tv.com/20250907/41921_bb51ee24/index.m3u8#第21集$https://vip.dytt-tv.com/20250907/41922_ab1417ec/index.m3u8#第22集$https://vip.dytt-tv.com/20250907/41923_09a0cc9c/index.m3u8#第23集$https://vip.dytt-tv.com/20250