伸,中野贵雄,儿玉宣胜,吉上亮,乙一','','　　故事设定在一个从未出现过奥特曼与怪兽的地球上。某天，一名外星人意外从宇宙坠落，他手持有着象征身份的红色宇宙回旋镖“奥美迦头镖”，并有着“究极”的称号。　　失去过往记忆的外星人 “奥美迦” 化身为地','更新至第11集','2025-07-05',28,'0','','','日本','国语','2025','','正片','','','','','',0,0,0,0,0,0,0,932,89,257,298,'',637,625,3.0,42,14,1757923918,1751685040,0,0,0,37125387,0.0,'','','','','','','','','','<p>　　故事设定在一个从未出现过奥特曼与怪兽的地球上。某天，一名外星人意外从宇宙坠落，他手持有着象征身份的红色宇宙回旋镖“奥美迦头镖”，并有着“究极”的称号。<br/>　　失去过往记忆的外星人 “奥美迦” 化身为地球人模样，被人称为“宙人”。初到地球的宙人，对人类充满好奇，积极主动地接触和了解这些陌生的生命体。<br/>　　当神秘巨型生物接连出现时，尘封的记忆碎片被唤醒，宙人认出这些生物正是记忆中的 “怪兽”。面对怪兽的威胁，强烈的使命感驱使他变身成为奥美迦奥特曼，与怪兽展开战斗。<br/>　　与此同时，地球上的人类对突然现身的巨型生物，以及手持红色头镖与之战斗的巨人充满疑惑。为探寻真相，人类开始从各个角度观察这位神秘巨人。随着故事推进，来自外星的宙人与一位普通青年逐渐成为并肩作战的伙伴。作品将通过他们之间的羁绊与经历，深度探索 “奥特曼为何要守护地球” 这一问题的答案。<br/>　　现在正是觉醒之时。</p>','dyttm3u8','no','','第01集$https://vip.dytt-hot.com/20250705/95863_95c44538/index.m3u8#第02集$https://vip.dytt-hot.com/20250712/96471_c08867af/index.m3u8#第03集$https://vip.dytt-hot.com/20250719/96960_f4a6f35f/index.m3u8#第04集$https://vip.dytt-cinema.com/20250726/28222_9764334f/index.m3u8#第05集$https://vip.dytt-cinema.com/20250802/28962_5103ae07/index.m3u8#第06集$https://vip.dytt-cinema.com/20250816/30476_b53c87a7/index.m3u8#第07集$https://vip.dytt-cinema.com/20250816/30477_1a0ef9c0/index.m3u8#第08集$https://vip.dytt-cinema.com/20250823/31437_3632435c/index.m3u8#第09集$https://vip.dytt-cinema.com/20250830/32651_b192efef/index.m3u8#第10集$https://vip.dytt-cine.com/20250906/54893_78aeaeb8/index.m3u8#第11集$https://vip.dytt-cinema.com/20250913/34256_0d421851/index.m3u8','','','','',0,'',''),(116,20,0,0,'奥美迦奥特曼日语','Ultraman Omega','aomeijiaaotemanriyu',1,'A','','奥美迦奥特曼日语,宙人,怪兽,记忆,特曼,外星人,地球','剧情,动作,科幻,日韩动漫','https://vip.dytt-img.com/upload/vod/20250705-1/fbdec09431d26b7ba83943e2d0e362a6.jpg','','','','近藤颂利,吉田晴登,工藤绫乃','武居正能,越知靖,市野龙一,铃木农史,田口清隆,辻本贵则','根元岁三,足木淳一郎,本田雅也,三好昭央,鹤田幸伸,中野贵雄,儿玉宣胜,吉上亮,乙一','','　　故事设定在一个从未出现过奥特曼与怪兽的地球上。某天，一名外星人意外从宇宙坠落，他手持有着象征身份的红色宇宙回旋镖“奥美迦头镖”，并有着“究极”的称号。　　失去过往记忆的外星人 “奥美迦” 化身为地','更新至第11集','2025-07-05',28,'0','','','日本','日语','2025','','正片','','','','',''